#include <stdio.h>
#include <string.h>
#include <stdlib.h>

int main(){
	char input[] = {"\\\\\0"};
	int x=0;
  int y=2;
  int i=0;
  char matriz[5][5] = {{'0','0','1','0','0'},{'0','2','3','4','0'},{'5','6','7','8','9'},{'0','A','B','C','0'},{'0','0','D','0','0'}};
  /*
   y\x 0  1  2  3  4
    0 [0][0][1][0][0]
    1 [0][2][3][4][0]
    2 [5][6][7][8][9]
    3 [0][A][B][C][0]
    4 [0][0][D][0][0]
  LUUL RUUL ULLU DUDU LDLU DDDL
  7
  */
  
  while (input[i]!=0){
    switch(input[i]){
    	case 'U':
    	  if ((matriz[y][x]!='5') && (matriz[y][x]!='2') && (matriz[y][x]!='1') && (matriz[y][x]!='4') && (matriz[y][x]!='9'))
    	    y--;
      break;
      case 'D':
       if ((matriz[y][x]!='5') && (matriz[y][x]!='A') && (matriz[y][x]!='D') && (matriz[y][x]!='C') && (matriz[y][x]!='9'))
         y++;
      break;
      case 'L':
        if ((matriz[y][x]!='1') && (matriz[y][x]!='2') && (matriz[y][x]!='5') && (matriz[y][x]!='A') && (matriz[y][x]!='D'))
          x--;
      break;
      case 'R':
        if ((matriz[y][x]!='1') && (matriz[y][x]!='4') && (matriz[y][x]!='9') && (matriz[y][x]!='C') && (matriz[y][x]!='D'))
          x++;
      break;
      default:
      	printf("%c", matriz[y][x]);
      break;
    }
    i++;
  }
  printf("%c\n", matriz[y][x]);
  return 0;
}
